    data: [12, 5, 6, 6, 9, 10],
    width: 400,
    height: 300,
    id: "a1",
  };

  render = () => {
    return (
      <div class="grid-container">
        <div class="grid-item">
          <BarChartScaled
            data={this.state.data}
            width={this.state.width}
            height={this.state.height}
            id={this.state.id}
          />
